   312        context: `File ${sourceFile} contains unresolved NEXT_PAGE_PLACEHOLDER`,
   313      },
   314      researcher,
   315      articleType,
   316      category,
   317      infoboxColor,
   318      randomSeed,
   319      ecosystemStats,
   320    };
   321  }
   322
